import react, { useState } from "react";

let button1 = document.querySelector("button");
function App(){
    let Tame = new Date().toLocaleTimeString();
    let [currTime , updatedTime] = useState(Tame);
    let updateTime = () => {
        Tame = new Date().toLocaleTimeString();
        updatedTime(Tame);
    };
    return (
    <>
    <div>
        <h1>{currTime}</h1>
        <button onClick ={updateTime} > Time update </button>
    </div>
    </>)

}
export default App;
